import './App.css';
import React, { useState } from "react";
import {BrowserRouter,Route,Switch } from 'react-router-dom';
import Home from './pages/Home';

function App() {

const[user,setUser] = useState(false);

  return (
    <BrowserRouter>
      <div className="App">
        <Switch>
          const[user,setUser] = useState(false);
          <Route
            exact
            path="/"
            render={() => <Home user={user} setUser={setUser} />}
          />
          <Route />
          <Route />
          <Route />
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
